import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import Nav from "../../components/Nav";
import axios from 'axios';
import LikeButton from '../../components/LikeButton';
import Pagination from '../../components/Pagination';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faUser as regularUser} from '@fortawesome/free-regular-svg-icons';
import { faHeart } from '@fortawesome/free-solid-svg-icons'; 


const MyPage = () => {
  const [projects, setProjects] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [projectsPerPage] = useState(5); 
  const [selectedList, setSelectedList] = useState('');
  const isLoggedIn = true; 
  const showSearch = false;

  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const response = await axios.get('data.json'); 
        setProjects(response.data);
      } catch (error) {
        console.error("Error fetching the projects:", error);
      }
    };

    fetchProjects();
  }, []);

  const indexOfLastProject = currentPage * projectsPerPage;
  const indexOfFirstProject = indexOfLastProject - projectsPerPage;
  const currentProjects = projects.slice(indexOfFirstProject, indexOfLastProject);

  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  const handleListClick = (listType) => {
    setSelectedList(listType);
    setCurrentPage(1); 
  };



  return (
    <Container>
      <Nav isLoggedIn={isLoggedIn} showSearch={showSearch}/>

      <List>
          <ul>
            <li><a href="#" onClick={() => handleListClick('applied')}>신청 목록</a></li>
            <li><a href="#" onClick={() => handleListClick('interested')}>관심 목록</a></li>
            <li><a href="#" onClick={() => handleListClick('written')}>작성 목록</a></li>
            <li><a href="#" onClick={() => handleListClick('saved')}>임시 저장</a></li>
            <li><a href="#" onClick={() => handleListClick('closed')}>마감 목록</a></li>
            <li><a href="#" onClick={() => handleListClick('profile')}>개인 정보</a></li>
          </ul>
      </List>
      <ProjectList>
        {selectedList === 'written' && currentProjects.map((project) => (
          <ProjectItem key={project.pk}>
            <ProjectHeader>
            <HeaderItem>
                <FontAwesomeIcon icon={regularUser} size="15px" />
                <span>{project.creatorID}</span>
              </HeaderItem>
              <HeaderItem>
                <FontAwesomeIcon icon={faHeart} color="red" size="15px" />
                <span>{project.likesCount}</span>
              </HeaderItem>

            </ProjectHeader>
            <p>{project.title}</p>
            <Tags>
              {project.tags.map((tag, index) => (
                <span key={index}>{tag}</span>
              ))}
            </Tags>
            <Button>모집 진행중</Button>
          </ProjectItem>
        ))}
      </ProjectList>


      {/* 페이지네이션 컴포넌트 사용 */}
      <Pagination 
        projectsPerPage={projectsPerPage} 
        totalProjects={projects.length} 
        paginate={paginate} 
        onPageChange={paginate} // 페이지 변경 핸들러 전달
      />

    </Container>
  );
};

export default MyPage;

const Container = styled.div`
 margin-top: 20vh;
 min-height: calc(100vh - 250px);
 display: flex;
 padding-top: 30px;
 flex-direction: column;
 align-items: center;
 z-index:1000;
`;


const List = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;

  ul {
    list-style: none;
    display: flex;
    gap: 20px;
  }

  a {

    border-radius: 5px;
    padding: 10px 20px;
    margin-right:20px;
    border: 1px solid ;
    border-radius: 30px 30px 1px 30px; //반시계 ㅔ방향
    box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
    border-color: rgba(160, 218, 251);
    background-color: white;
    color: #0A8ED9 ;
    text-decoration: none;
    }
    a:hover {
        background-color: rgba(160, 218, 251);
        color: white; 1
    }

  }
`;



const ProjectList = styled.div`
  padding: 20px;
`;

const ProjectItem = styled.div`
  border: 1px solid #e0e0e0;
  border-radius: 8px;
  padding: 15px;
  margin-bottom: 15px;
`;

const ProjectHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const HeaderItem = styled.div`
  display: flex;
  align-items: center; // 아이콘과 텍스트 수직 정렬
  margin-right: 10px; // 오른쪽 여백 추가
  & > span {
    margin-left: 5px; // 아이콘과 텍스트 사이의 간격
  }
`;

const Tags = styled.div`
  margin: 10px 0;

  span {
    background-color: #e0e0e0;
    border-radius: 4px;
    padding: 5px;
    margin-right: 5px;
  }
`;

const Button = styled.button`
  background-color: #007bff;
  color: white;
  border: none;
  padding: 10px 15px;
  border-radius: 5px;
  cursor: pointer;
`;
